  warn.style.color='#1e52a8';
}


</script>













<script>




updateProgressBar(6); 


function updateProgressBar(currentPage) {
    const circles = document.querySelectorAll(".circle");
    const progressBar = document.querySelector(".indicator");
  
    let currentStep = currentPage;
    
    circles.forEach((circle, index) => {
        circle.classList[`${index < currentStep ? "add" : "remove"}`]("active");
    });

    progressBar.style.width = `${((currentStep - 1) / (circles.length - 1)) * 100}%`;
}



    const circles = document.querySelectorAll(".circle"),
    progressBar = document.querySelector(".indicator"),
    buttons = document.querySelectorAll("button");
   
   let currentStep = 1;
   
   // function that updates the current step and updates the DOM
   const updateSteps = (e) => {
    // update current step based on the button clicked
    currentStep = e.target.id === "next" ? ++currentStep : --currentStep;
   
    // loop through all circles and add/remove "active" class based on their index and current step
    circles.forEach((circle, index) => {
      circle.classList[`${index < currentStep ? "add" : "remove"}`]("active");
    });
   
    // update progress bar width based on current step
    progressBar.style.width = `${((currentStep - 1) / (circles.length - 1)) * 100}%`;
   
    // check if current step is last step or first step and disable corresponding buttons
    if (currentStep === circles.length) {
      buttons[1].disabled = true;
    } else if (currentStep === 1) {
      buttons[0].disabled = true;
    } else {
      buttons.forEach((button) => (button.disabled = false));
    }
   };
   
 
   buttons.forEach((button) => {
    button.addEventListener("click", updateSteps);
   });
   
   
   








// Cette fonction vérifie si la signature est valide
function isSignatureValid() {
  var signatureDataUrl = canvas.toDataURL(); // Obtenez la Data URL de la signature actuelle

  if (signatureDataUrl === userSignature) {
    // Les signatures correspondent
    console.log("La signature est valide.");
    var warningElement = document.getElementById("warn");
    warningElement.classList.add("hidden"); // Masquez le message d'avertissement
    warningElement.style.color = ''; // Réinitialisez la couleur du texte
  } else {
    // Les signatures ne correspondent pas
    console.log("La signature est invalide.");
    var warningElement = document.getElementById("warn");
    warningElement.classList.remove("hidden"); // Montrez le message d'avertissement
    warningElement.style.color = '#ff6666'; // Changez la couleur du texte en rouge
  }
}

// Nous ajoutons cette fonction à l'événement 'submit' du formulaire
document.getElementById('SignForm').addEventListener('submit', function(e) {
  e.preventDefault(); // Nous prévenons l'action par défaut pour avoir le temps de vérifier la signature
  isSignatureValid();
});




   
   </script>


